The best place to reference when looking at tests within Oxen are the lib/src/repositories modules themselves. You'll find some familiar names within the repositories:: namespace. For example: repositories::init repositories::add repositories::commit We follow a Domain Driven Design approach to development. The tests are located within the same module as the code they are testing. Checkout all the domain objects here . All tests for these commands are found below their respective module. Let's look at an example command and break down the different parts of the test. #[cfg(test)]
mod tests { // ... include necessary modules #[test] fn test_repositories_init() -> Result<(), OxenError> { test::run_empty_dir_test(|repo_dir| { // Init repo let repo = repositories::init(repo_dir)?; // Init should create the .oxen directory let hidden_dir = util::fs::oxen_hidden_dir(repo_dir); let config_file = util::fs::config_filepath(repo_dir); assert!(hidden_dir.exists()); assert!(config_file.exists()); Ok(()) }) }
} First you will notice that the tests are within a mod tests block. This is a Rust feature that allows you to group tests together within a particular module. In order to run all the tests within a particular command module you can run: cargo test --lib repositories::init This will run all the tests within the repositories::init module.

